        // 1 -> v > x + th
        // 2 -> v < x - th
        // 0 -> x - th <= v <= x + th
        __device__ __forceinline__ int diffType(const int v, const int x, const int th)
        {
            const int diff = x - v;

            return static_cast<int>(diff < -th) + (static_cast<int>(diff > th) << 1);
        }

        __device__ void calcMask(const uint C[4], const int v, const int th, int& mask1, int& mask2)
        {
            mask1 = 0;
            mask2 = 0;

            int d1, d2;



            d1 = diffType(v, C[0] & 0xff, th);
            d2 = diffType(v, C[2] & 0xff, th);

            if ((d1 | d2) == 0)
                return;

            mask1 |= (d1 & 1) << 0;
            mask2 |= ((d1 & 2) >> 1) << 0;

            mask1 |= (d2 & 1) << 8;
            mask2 |= ((d2 & 2) >> 1) << 8;



            d1 = diffType(v, C[1] & 0xff, th);
            d2 = diffType(v, C[3] & 0xff, th);

            if ((d1 | d2) == 0)
                return;

            mask1 |= (d1 & 1) << 4;
            mask2 |= ((d1 & 2) >> 1) << 4;

            mask1 |= (d2 & 1) << 12;
            mask2 |= ((d2 & 2) >> 1) << 12;



            d1 = diffType(v, (C[0] >> (2 * 8)) & 0xff, th);
            d2 = diffType(v, (C[2] >> (2 * 8)) & 0xff, th);

            if ((d1 | d2) == 0)
                return;

            mask1 |= (d1 & 1) << 2;
            mask2 |= ((d1 & 2) >> 1) << 2;

            mask1 |= (d2 & 1) << 10;
            mask2 |= ((d2 & 2) >> 1) << 10;



            d1 = diffType(v, (C[1] >> (2 * 8)) & 0xff, th);
            d2 = diffType(v, (C[3] >> (2 * 8)) & 0xff, th);

            if ((d1 | d2) == 0)
                return;

            mask1 |= (d1 & 1) << 6;
            mask2 |= ((d1 & 2) >> 1) << 6;

            mask1 |= (d2 & 1) << 14;
            mask2 |= ((d2 & 2) >> 1) << 14;



            d1 = diffType(v, (C[0] >> (1 * 8)) & 0xff, th);
            d2 = diffType(v, (C[2] >> (1 * 8)) & 0xff, th);

            /*if ((d1 | d2) == 0)
                return;*/

            mask1 |= (d1 & 1) << 1;
            mask2 |= ((d1 & 2) >> 1) << 1;

            mask1 |= (d2 & 1) << 9;
            mask2 |= ((d2 & 2) >> 1) << 9;



            d1 = diffType(v, (C[0] >> (3 * 8)) & 0xff, th);
            d2 = diffType(v, (C[2] >> (3 * 8)) & 0xff, th);

            /*if ((d1 | d2) == 0)
                return;*/

            mask1 |= (d1 & 1) << 3;
            mask2 |= ((d1 & 2) >> 1) << 3;

            mask1 |= (d2 & 1) << 11;
            mask2 |= ((d2 & 2) >> 1) << 11;



            d1 = diffType(v, (C[1] >> (1 * 8)) & 0xff, th);
            d2 = diffType(v, (C[3] >> (1 * 8)) & 0xff, th);

            /*if ((d1 | d2) == 0)
                return;*/

            mask1 |= (d1 & 1) << 5;
            mask2 |= ((d1 & 2) >> 1) << 5;

            mask1 |= (d2 & 1) << 13;
            mask2 |= ((d2 & 2) >> 1) << 13;



            d1 = diffType(v, (C[1] >> (3 * 8)) & 0xff, th);
            d2 = diffType(v, (C[3] >> (3 * 8)) & 0xff, th);

            mask1 |= (d1 & 1) << 7;
            mask2 |= ((d1 & 2) >> 1) << 7;

            mask1 |= (d2 & 1) << 15;
            mask2 |= ((d2 & 2) >> 1) << 15;
        }

        // 1 -> v > x + th
        // 2 -> v < x - th
        // 0 -> not a keypoint
        __device__ __forceinline__ bool isKeyPoint(int mask1, int mask2)
        {
            return (__popc(mask1) > 8 && (c_table[(mask1 >> 3) - 63] & (1 << (mask1 & 7)))) ||
                   (__popc(mask2) > 8 && (c_table[(mask2 >> 3) - 63] & (1 << (mask2 & 7))));
        }

        __device__ int cornerScore(const uint C[4], const int v, const int threshold)
        {
            // binary search in [threshold + 1, 255]

            int min = threshold + 1;
            int max = 255;

            while (min <= max)
            {
                const int mid = (min + max) >> 1;

                int mask1 = 0;
                int mask2 = 0;

                calcMask(C, v, mid, mask1, mask2);

                int isKp = static_cast<int>(isKeyPoint(mask1, mask2));

                min = isKp * (mid + 1) + (isKp ^ 1) * min;
                max = (isKp ^ 1) * (mid - 1) + isKp * max;
            }

            return min - 1;
        }

        __device__ bool isKeyPoint2(const PtrStepSzb img, const int i, const int j, const int threshold, PtrStepi scoreMat) {
          int v;
          uint C[4] = {0,0,0,0};

          C[2] |= static_cast<uint>(img(i - 3, j - 1)) << 8;
          C[2] |= static_cast<uint>(img(i - 3, j));
          C[1] |= static_cast<uint>(img(i - 3, j + 1)) << (3 * 8);

          C[2] |= static_cast<uint>(img(i - 2, j - 2)) << (2 * 8);
          C[1] |= static_cast<uint>(img(i - 2, j + 2)) << (2 * 8);

          C[2] |= static_cast<uint>(img(i - 1, j - 3)) << (3 * 8);
          C[1] |= static_cast<uint>(img(i - 1, j + 3)) << 8;

          C[3] |= static_cast<uint>(img(i, j - 3));
          v     = static_cast<int>(img(i, j));
          C[1] |= static_cast<uint>(img(i, j + 3));

          int d1 = diffType(v, C[1] & 0xff, threshold);
          int d2 = diffType(v, C[3] & 0xff, threshold);

          if ((d1 | d2) == 0) {
            return false;
          }
          C[3] |= static_cast<uint>(img(i + 1, j - 3)) << 8;
          C[0] |= static_cast<uint>(img(i + 1, j + 3)) << (3 * 8);

          C[3] |= static_cast<uint>(img(i + 2, j - 2)) << (2 * 8);
          C[0] |= static_cast<uint>(img(i + 2, j + 2)) << (2 * 8);

          C[3] |= static_cast<uint>(img(i + 3, j - 1)) << (3 * 8);
          C[0] |= static_cast<uint>(img(i + 3, j));
          C[0] |= static_cast<uint>(img(i + 3, j + 1)) << 8;

          int mask1 = 0;
          int mask2 = 0;

          calcMask(C, v, threshold, mask1, mask2);
          if (isKeyPoint(mask1, mask2)) {
            scoreMat(i, j) = cornerScore(C, v, threshold);
            return true;
          } else {
            return false;
          }
        }

        __device__ bool isMax(short2 loc, PtrStepi scoreMat) {
          int score = scoreMat(loc.y, loc.x);
          bool ismax =
            score > scoreMat(loc.y - 1, loc.x - 1) &&
            score > scoreMat(loc.y - 1, loc.x    ) &&
            score > scoreMat(loc.y - 1, loc.x + 1) &&

            score > scoreMat(loc.y    , loc.x - 1) &&
            score > scoreMat(loc.y    , loc.x + 1) &&

            score > scoreMat(loc.y + 1, loc.x - 1) &&
            score > scoreMat(loc.y + 1, loc.x    ) &&
            score > scoreMat(loc.y + 1, loc.x + 1);
          return ismax;
        }

        __global__ void tileCalcKeypoints(const PtrStepSzb img, short2 * kpLoc, float * kpScore, const unsigned int maxKeypoints, const int highThreshold, const int lowThreshold, PtrStepi scoreMat, unsigned int * counter_ptr) {
            const int j = threadIdx.x + blockIdx.x * blockDim.x + 3;
            const int i = threadIdx.y + blockIdx.y * blockDim.y + 3;
            const int tid = threadIdx.y * blockDim.x + threadIdx.x;
            __shared__ bool hasKp;
            if (tid == 0) {
              hasKp = false;
            }

            bool isKp = false;
            if (i < img.rows - 3 && j < img.cols - 3) {
              if (isKeyPoint2(img, i, j, highThreshold, scoreMat)) {
                isKp = true;
              }
            }
            // barrieer
            __syncthreads();
            if (isKp) {
                isKp = false;
                short2 loc = make_short2(j, i);
                int score = scoreMat(loc.y, loc.x);
                if (isMax(loc, scoreMat)) {
                  hasKp = true;
                  const unsigned int ind = atomicInc(counter_ptr, (unsigned int)(-1));
                  if (ind < maxKeypoints) {
                    kpLoc[ind] = loc;
                    kpScore[ind] = static_cast<float>(score);
                  }
                }
            }
            // barrieer
            __syncthreads();
            if (hasKp) return ;

            // lower the threshold and try again
            if (i < img.rows - 3 && j < img.cols - 3) {
              scoreMat(i, j) = 0;
              if (isKeyPoint2(img, i, j, lowThreshold, scoreMat)) {
                isKp = true;
              }
            }
            // barrieer
            __syncthreads();
            if (isKp) {
                short2 loc = make_short2(j, i);
                int score = scoreMat(loc.y, loc.x);
                if (isMax(loc, scoreMat)) {
                  hasKp = true;
                  const unsigned int ind = atomicInc(counter_ptr, (unsigned int)(-1));
                  if (ind < maxKeypoints) {
                    kpLoc[ind] = loc;
                    kpScore[ind] = static_cast<float>(score);
                  }
                }
            }
        }

  void tileDetect_gpu(InputArray _image, int minBorderX, int maxBorderX, int minBorderY, int maxBorderY, std::vector<KeyPoint> &keypoints, int highThreshold, int lowThreshold) {
    const unsigned int maxKeypoints = 10000;

    short2 * kpLoc;
    checkCudaErrors( cudaMallocManaged(&kpLoc, sizeof(short2) * maxKeypoints) );
    float * kpScore;
    checkCudaErrors( cudaMallocManaged(&kpScore, sizeof(float) * maxKeypoints) );

    unsigned int * counter_ptr;
    checkCudaErrors( cudaMalloc(&counter_ptr, sizeof(unsigned int)) );
    checkCudaErrors( cudaMemsetAsync(counter_ptr, 0, sizeof(unsigned int)) );

    const cv::cuda::GpuMat image = _image.getGpuMat();
    cv::cuda::GpuMat scoreMat(image.size(), CV_32SC1, Scalar::all(0));

    const int width = maxBorderX - minBorderX;
    const int height = maxBorderY - minBorderY;
    dim3 dimBlock(32, 32);
    dim3 dimGrid(divUp(width, 32), divUp(height, 32));

    tileCalcKeypoints<<<dimGrid, dimBlock>>>(image, kpLoc, kpScore, maxKeypoints, highThreshold, lowThreshold, scoreMat, counter_ptr);

    unsigned int count;
    checkCudaErrors( cudaMemcpyAsync(&count, counter_ptr, sizeof(unsigned int), cudaMemcpyDeviceToHost) );

    checkCudaErrors( cudaStreamSynchronize(0) );

    count = std::min(count, maxKeypoints);
    keypoints.resize(count);
    for (int i = 0; i < count; ++i) {
      KeyPoint kp(kpLoc[i].x, kpLoc[i].y, static_cast<float>(FEATURE_SIZE), -1, kpScore[i]);
      keypoints[i] = kp;
    }
    checkCudaErrors( cudaFree(counter_ptr) );
    checkCudaErrors( cudaFree(kpLoc) );
    checkCudaErrors( cudaFree(kpScore) );
    return ;
  }
